import React from "react";

import Header from "./Header";
import SlideMenu from "./SlideMenu";
import StoreGrid from "./StoreGrid";

const App = () => {
  return (
    <div className='app'>
      <Header />
      <SlideMenu />
      <StoreGrid />
    </div>
  );
};

export default App;
